import React, { useEffect } from 'react';
import { withStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import Dialog from '@material-ui/core/Dialog';
import MuiDialogTitle from '@material-ui/core/DialogTitle';
import MuiDialogContent from '@material-ui/core/DialogContent';
import MuiDialogActions from '@material-ui/core/DialogActions';
import IconButton from '@material-ui/core/IconButton';
import CancelIcon from './Cancelbutton .png';
import CallIcon from './call.png';
import Typography from '@material-ui/core/Typography';
import stylescss from "./CallWidget.css";


const styles = (theme) => ({
  root: {
  },
  dialogTitle:{
    backgroundColor:'#000000',
    width:'200px',
    textAlign : 'center',
  },
  dialog:{
    color:'white',
    fontWeight:'bold',
  },
});

const DialogTitle = withStyles(styles)((props) => {
  const { children, classes, onClose, ...other } = props;
  return (
    <MuiDialogTitle  className={classes.dialogTitle} >
      <Typography className={classes.dialog} variant="h6">{children}</Typography>
      {/* {onClose ? (
        <IconButton aria-label="close"  onClick={onClose}>
          <img src={CancelIcon} className={classes.closeButton} alt="cancel button"/>
        </IconButton>
      ) : null} */}
    </MuiDialogTitle>
  );
});

const contentStyles = (theme) => ({
  dialogContent:{
    textAlign : 'center',
  },
  dialog:{
    backgroundColor:'#AFEF8A',
    borderRadius:'20px',
    color:'green',
    fontWeight:'bold',
  },
  CallIcon:{
    height:'20px',
    width:'20px',
    justifyContent:'center'
  }

}) 

// const DialogContent = withStyles((styles) => ({
//   root: {
//     textAlign:'center',
//     // backgroundColor:'green',
//   },

// }))(MuiDialogContent);

const DialogContent = withStyles(contentStyles)((props) => {
  const { children, classes, onClose, ...other } = props;
  return (
    <MuiDialogContent  className={classes.dialogContent} >
      <Typography className={classes.dialog} variant="h6">
        <img src={CallIcon} className={classes.CallIcon} alt="callIcon"/> {children}</Typography>
    </MuiDialogContent>
  );
});

const DialogActions = withStyles((theme) => ({
  root: {
    margin: 0,
    padding: theme.spacing(1),
  },
  closeIcon:{
    height:'10px',

  }
}))(MuiDialogActions);


export default function CustomizedDialogs() {
  const [open, setOpen] = React.useState(false);
  const [nasaData,  setData] = React.useState({ });

  async function fetchData() {
    const res = await fetch("https://codifyinditest.com/script_test/api-test/")
    const data = await res.json()
    setData(data)
  }

  useEffect(() => {
    fetchData()
  }, [])

  const handleClickOpen = () => {
    setOpen(true);
    console.log('clicked true');
  };
  const handleClose = () => {
    console.log('clicked true');
    setOpen(false);
  };

  const { labels, phone_number } = nasaData['script test'] || {};

  const onValue = nasaData['script test'];
  console.log('apple', onValue);



  return (
    <div>
      <Button variant="outlined" color="primary" onClick={handleClickOpen}>
        Call Us Now
      </Button>
      <Dialog onClose={handleClose} aria-labelledby="customized-dialog-title" open={open}>
        <DialogTitle id="customized-dialog-title" onClose={handleClose}>
          {labels}
        </DialogTitle>
        <DialogContent id="customized-dialog-content" >
          {/* <Typography className={stylescss.content}> */}
            {phone_number}
          {/* </Typography> */}
        </DialogContent>
        <DialogActions>
          <Button autoFocus className={stylescss.closeIcon} onClick={handleClose} color="primary">
            Cancel
            {/* <div className={stylescss.closeIcon}> */}
            {/* <img src={CancelIcon} alt="cancel button"/> */}
            {/* </div> */}
            {/* {CancelIcon} */}
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}
